import React from 'react';
import ReactDOM from 'react-dom';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import './index.css';
import * as serviceWorker from './serviceWorker';
import LandingPage from './pages/LandingPage/home';
import TopProvincePage from './pages/TopProvince/TopProvince';
import TopPlacesPage from './pages/TopPlaces/TopPlaces';
import searchMap from './pages/SearchResult/searchMap';
import Maps01 from './pages/Maps/mapsProv01';
import Maps02 from './pages/Maps/mapsProv02';
import Maps03 from './pages/Maps/mapsProv03';
import Maps04 from './pages/Maps/mapsProv04';
import Maps05 from './pages/Maps/mapsProv05';
import Maps06 from './pages/Maps/mapsProv06';
import Maps07 from './pages/Maps/mapsProv07';
import Maps08 from './pages/Maps/mapsProv08';
import Maps09 from './pages/Maps/mapsProv09';
import Maps10 from './pages/Maps/mapsProv10';
import Place01 from './pages/Maps/mapsPlace01';
import Place02 from './pages/Maps/mapsPlace02';
import Place03 from './pages/Maps/mapsPlace03';
import Place04 from './pages/Maps/mapsPlace04';
import Place05 from './pages/Maps/mapsPlace05';
import Place06 from './pages/Maps/mapsPlace06';
import Place07 from './pages/Maps/mapsPlace07';
import Place08 from './pages/Maps/mapsPlace08';
import Place09 from './pages/Maps/mapsPlace09';
import Place10 from './pages/Maps/mapsPlace10';
import Place11 from './pages/Maps/mapsPlace11';
import Place12 from './pages/Maps/mapsPlace12';
import Place13 from './pages/Maps/mapsPlace13';
import Place14 from './pages/Maps/mapsPlace14';
import Place15 from './pages/Maps/mapsPlace15';
import Place16 from './pages/Maps/mapsPlace16';
import Place17 from './pages/Maps/mapsPlace17';
import Place18 from './pages/Maps/mapsPlace18';
import Place19 from './pages/Maps/mapsPlace19';
import Place20 from './pages/Maps/mapsPlace20';

ReactDOM.render(
    <React.StrictMode>
        <Router>
            <Switch>
                <Route exact path="/" component={LandingPage} />
                <Route path="/province" component={TopProvincePage} />
                <Route path="/places" component={TopPlacesPage} />

                <Route path="/top1Province" component={Maps01} />
                <Route path="/top2Province" component={Maps02} />
                <Route path="/top3Province" component={Maps03} />
                <Route path="/top4Province" component={Maps04} />
                <Route path="/top5Province" component={Maps05} />
                <Route path="/top6Province" component={Maps06} />
                <Route path="/top7Province" component={Maps07} />
                <Route path="/top8Province" component={Maps08} />
                <Route path="/top9Province" component={Maps09} />
                <Route path="/top10Province" component={Maps10} />

                <Route path="/top1Place" component={Place01} />
                <Route path="/top2Place" component={Place02} />
                <Route path="/top3Place" component={Place03} />
                <Route path="/top4Place" component={Place04} />
                <Route path="/top5Place" component={Place05} />
                <Route path="/top6Place" component={Place06} />
                <Route path="/top7Place" component={Place07} />
                <Route path="/top8Place" component={Place08} />
                <Route path="/top9Place" component={Place09} />
                <Route path="/top10Place" component={Place10} />
                <Route path="/top11Place" component={Place11} />
                <Route path="/top12Place" component={Place12} />
                <Route path="/top13Place" component={Place13} />
                <Route path="/top14Place" component={Place14} />
                <Route path="/top15Place" component={Place15} />
                <Route path="/top16Place" component={Place16} />
                <Route path="/top17Place" component={Place17} />
                <Route path="/top18Place" component={Place18} />
                <Route path="/top19Place" component={Place19} />
                <Route path="/top20Place" component={Place20} />

                <Routh path="/topProvince/:rank" component={Maps01} />
                <Route path="/searchMap/:searchTerm" component={searchMap} />

            </Switch>
        </Router>
    </React.StrictMode>,
document.getElementById('root')
);

serviceWorker.unregister();
